let acum = 1;

const cambiarPagina = function(acum){
   if (acum === 1){
       acum +=1;
   }else if (acum === 42) {
       acum -= 1;
   }
   console.log(acum)
   return acum;
};
export default function SearchBar(props, acum) {
   return (
      <div className={style.container}>
         <input className={style.input} type='search' />
         <button className={style.button} onClick={props.onSearch}>Buscar</button>
            <button className={style.buttonP} onClick= {cambiarPagina(acum)}>Prev</button>
            <p className={style.elementP}>Page {acum}</p>
            <button className={style.buttonP} onClick= {cambiarPagina(acum)}>Next</button>
      </div>

   );
}
 export {acum}
